const Player=({isMe})=>{

    const card1={
        value:"3",
        type:"D"
      }
      const card2={

        value:"J",
        type:"D"
      }
      const card3={

        value:"K",
        type:"H"
      }
      const card5={

        value:"K",
        type:"C"
      }
      const card4={

        value:"A",
        type:"H"
      }
      const cardList=[]

      cardList.push(card1)
      cardList.push(card2)
      cardList.push(card3)
      cardList.push(card4)
      cardList.push(card5)


      return (
        <div className={styles.handContainer}>
        <div className={styles.cardContainer}
             style >
          {cardList.map((card, index)=><Card 
          key={index}
          index={index}
          value={card.value}
          type={card.type}
          num={cardList.length}
          isDealer={false}
         />)}

        </div>
        </div>
      );

}
export default Player
